[
  {
    "name": "Banana Bread",
    "ingredients": [
      {
        "name": "Flour",
        "amount": "1 1/2 cups",
        "type": "all-purpose"
      },
      {
        "name": "Baking soda",
        "amount": "1 teaspoon"
      },
      {
        "name": "Salt",
        "amount": "1/2 teaspoon"
      },
      {
        "name": "Cinnamon",
        "amount": "1 teaspoon"
      },
      {
        "name": "Nutmeg",
        "amount": "1/4 teaspoon"
      },
      {
        "name": "Bananas",
        "amount": "3 ripe",
        "type": "mashed"
      },
      {
        "name": "Sugar",
        "amount": "3/4 cup"
      },
      {
        "name": "Eggs",
        "amount": "2 large"
      },
      {
        "name": "Vanilla extract",
        "amount": "1 teaspoon"
      },
      {
        "name": "Melted butter",
        "amount": "1/2 cup"
      }
    ],
    "instructions": [
      "Preheat oven to 350 degrees F (175 degrees C). Grease and flour a 9x5 inch loaf pan.",
      "In a large bowl, whisk together the flour, baking soda, salt, cinnamon, and nutmeg.",
      "In a separate bowl, cream together the mashed bananas, sugar, eggs, and vanilla extract.",
      "Gradually add the wet ingredients to the dry ingredients, mixing until just combined.",
      "Stir in the melted butter.",
      "Pour batter into the prepared loaf pan and bake for 50-60 minutes, or until a toothpick inserted into the center comes out clean.",
      "Let cool in the pan for 10 minutes before inverting onto a wire rack to cool completely."
    ]
  }
]
